import React, {useState} from 'react';

import { LineChart, 
        Line, 
        CartesianGrid, 
        XAxis, 
        YAxis,
         Tooltip 
       } from 'recharts';

const data = [{name: 'Page A', uv: 400, pv: 2400, amt: 2400},
              {name: 'Page B', uv: 500, pv: 1000, amt: 2300},
              {name: 'Page C', uv: 450, pv: 2600, amt: 2500}];
const data2 = [{name: 'Page A', uv: 400, pv: 1500, amt: 2400},
              {name: 'Page B', uv: 500, pv: 3000, amt: 2300},
              {name: 'Page C', uv: 450, pv: 2000, amt: 2500}];

function RenderLineChart() {

  const [_data, setData] = useState(data)
  const handleClick = (event) => setData(data2)

  return (
  <div> 
    <button onClick = {(event) => handleClick(event)}>Update Data</button>

    <LineChart 
      width={600} 
      height={300} 
      data={_data} 
      margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
    <Line type="monotone" dataKey="pv" stroke="#8884d8" />
    <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
    <XAxis dataKey="name" />
    <YAxis />
  </LineChart>
  </div>
  )
}


export default RenderLineChart
